static void* lookup_wasm2c_nonfunc_export(void* sbx_ptr, const char* name) {
  wasm2c_sandbox_t* const sbx = (wasm2c_sandbox_t* const) sbx_ptr;
  if (strcmp("w2c_memory", name) == 0){
    return &(sbx->w2c_memory);
  }
  if (strcmp("w2c___indirect_function_table", name) == 0){
    return &(sbx->w2c___indirect_function_table);
  }
  if (strcmp("w2c___stack_pointer", name) == 0){
    return &(sbx->w2c___stack_pointer);
  }
  if (strcmp("w2c___dso_handle", name) == 0){
    return &(sbx->w2c___dso_handle);
  }
  if (strcmp("w2c___data_end", name) == 0){
    return &(sbx->w2c___data_end);
  }
  if (strcmp("w2c___global_base", name) == 0){
    return &(sbx->w2c___global_base);
  }
  if (strcmp("w2c___heap_base", name) == 0){
    return &(sbx->w2c___heap_base);
  }
  if (strcmp("w2c___memory_base", name) == 0){
    return &(sbx->w2c___memory_base);
  }
  if (strcmp("w2c___table_base", name) == 0){
    return &(sbx->w2c___table_base);
  }
  return 0;
}

